tables.table_schema:
CREATE TABLE quantum_simulation_experiments (
  experiment_id INT PRIMARY KEY,
  experiment_date DATE,
  simulation_type VARCHAR(50),
  result_description TEXT
);

CREATE TABLE quantum_simulation_experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(255) NOT NULL,
    experiment_date DATE NOT NULL,
    experiment_description TEXT
);

CREATE TABLE simulation_results (
    result_id INT PRIMARY KEY,
    experiment_id INT NOT NULL,
    result_data JSON,
    result_timestamp TIMESTAMP
);

CREATE TABLE comparison_data (
    comparison_id INT PRIMARY KEY,
    experiment_id INT NOT NULL,
    comparison_result TEXT,
    comparison_date DATE
);

CREATE TABLE quantum_simulations (
    id INT PRIMARY KEY,
    experiment_date DATE,
    simulation_result FLOAT
);

CREATE TABLE experiment_details (
    experiment_id INT PRIMARY KEY,
    experiment_description TEXT,
    researcher_name VARCHAR(50),
    research_field VARCHAR(50)
);

CREATE TABLE simulation_parameters (
    simulation_id INT PRIMARY KEY,
    experiment_id INT,
    parameter_name VARCHAR(50),
    parameter_value FLOAT
);

CREATE TABLE comparison_results (
    comparison_id INT PRIMARY KEY,
    simulation_id1 INT,
    simulation_id2 INT,
    similarity_score FLOAT
);
